import React from 'react'
import {AppBar, Toolbar, IconButton} from '@material-ui/core'

const navLinks =[
    {title:'Home', path:'/'},
    {title:'Random', path:'/random'}
]

function Navbar(){
    return (
    <AppBar position="static">
      <Toolbar>
        <IconButton edge="start" color="inherit" aria-label="home">
          Nimbus 3D
        </IconButton>
      </Toolbar>
    </AppBar>
    )
}

export default Navbar
